import {StyleSheet} from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        display: "flex",
        flexDirection: "row",
        height: 100,
        justifyContent: "space-between",
        marginRight: 10,
        marginLeft: 10
    },

    nom: {
        alignItems: "center",
    },

    icon: {

    }
})

export default styles;
